import { Link } from 'react-router-dom';
import s from './Header.module.css';
import { ReactComponent as LoginSVG } from './img/login.svg';

const HeaderMobile = () => {

    return (
        <>
            <div className={s.logo}>
                <p>LOGO</p>
                <Link to="">
                    <LoginSVG />
                </Link>
            </div>

        </>
    );
}

export default HeaderMobile;
